import React from 'react'
import Index from './components/Index.js'
import ReactDOM from 'react-dom';
import { BrowserRouter } from 'react-router-dom';

const root = document.getElementById('root');

ReactDOM.render(
  <React.StrictMode>
    <BrowserRouter>
      <Index />
      </BrowserRouter>
  </React.StrictMode>,
  root
);
